import { useState } from "react";

const Dashboard = () => {
  const [search, setSearch] = useState("");

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      {/* Search Bar */}
      <div className="max-w-3xl mx-auto">
        <input
          type="text"
          placeholder="Search..."
          className="w-full px-4 py-2 border rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-400"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />
      </div>

      {/* Widgets Section */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mt-8 max-w-4xl mx-auto">
        {/* Widget 1 */}
        <div className="p-6 bg-white rounded-lg shadow-md">
          <h3 className="text-lg font-semibold">Widget 1</h3>
          <p className="text-gray-600">Details about widget 1</p>
        </div>

        {/* Widget 2 */}
        <div className="p-6 bg-white rounded-lg shadow-md">
          <h3 className="text-lg font-semibold">Widget 2</h3>
          <p className="text-gray-600">Details about widget 2</p>
        </div>

        {/* Widget 3 */}
        <div className="p-6 bg-white rounded-lg shadow-md">
          <h3 className="text-lg font-semibold">Widget 3</h3>
          <p className="text-gray-600">Details about widget 3</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
